import { useSelector, useDispatch } from "react-redux";

function Cart() {
  const cart = useSelector((state) => state.cart.cartList);
  return (
    <div>
      Here is your cart
      {cart.map((c) => {
        return <p>{c}</p>;
      })}
    </div>
  );
}

export default Cart;
